tables.Tie-breaking criteria for group play:
The ranking of teams in the group stage was determined as follows: Points obtained in all group matches; Goal difference in all group matches; Number of goals scored in all group matches; Points obtained in the matches played between the teams in question; Goal difference in the matches played between the teams in question; Number of goals scored in the matches played between the teams in question; Fair play points in all group matches (only one deduction could be applied to a player in a single match): Yellow card: −1 points;
   Indirect red card (second yellow card): −3 points;
   Direct red card: −4 points;
   Yellow card and direct red card: −5 points; Drawing of lots.
